import React from 'react';
import Vscode from '../images/editors/img_vscode.png';
import Sublime from '../images/editors/img_sublime.png';

export const EditorsList = [
    {   
        id:"1",
        name:"Vscode",
        source:Vscode,
        url:"www.hackerrank.com",
    },
    {   
        id:"2",
        name:"Atom",
        source:"https://www.google.com/imgres?imgurl=https%3A%2F%2Fseeklogo.com%2Fimages%2FA%2Fatom-logo-19BD90FF87-seeklogo.com.png&imgrefurl=https%3A%2F%2Fseeklogo.com%2Fvector-logo%2F273141%2Fatom&tbnid=LRWYfZyqE8g7CM&vet=12ahUKEwiI1dGvwIjqAhWQnEsFHeTzD5UQMygBegUIARCsAQ..i&docid=ozAGpaguDHcAzM&w=300&h=300&q=atom%20editor%20logo&hl=en&ved=2ahUKEwiI1dGvwIjqAhWQnEsFHeTzD5UQMygBegUIARCsAQ",
        url:"www.hackerearth.com",
    },
    {   
        id:"3",
        name:"Sublime",
        source:Sublime,
        url:"www.codechef.com",
    },
    {   
        id:"4",
        name:"Brackets",
        source:"https://www.google.com/imgres?imgurl=https%3A%2F%2Fupload.wikimedia.org%2Fwikipedia%2Fcommons%2Fthumb%2F4%2F4c%2FBrackets_Icon.svg%2F1200px-Brackets_Icon.svg.png&imgrefurl=https%3A%2F%2Fen.wikipedia.org%2Fwiki%2FBrackets_(text_editor)&tbnid=uCBzV0gZnwEdbM&vet=12ahUKEwjytoDAwojqAhUNYCsKHXFuBCIQMygAegUIARDAAQ..i&docid=lWxlxCogp9Z8XM&w=1200&h=1200&q=brackets%20logo&hl=en&ved=2ahUKEwjytoDAwojqAhUNYCsKHXFuBCIQMygAegUIARDAAQ",
